import React from 'react';
import { View, StyleSheet, Text } from 'react-native';

const Post = () => {
  return (
       <View style={styles.container}>
         <Text>This is Post page</Text>
       </View>
  );
}

const styles = StyleSheet.create({
  container: { 
     flex: 1,
    alignItems: 'center', 
    justifyContent: 'center', 
    backgroundColor: '#fff',
  },
});
export default Post;
